package lc_work.easy.ImplementStrStr;

public class Solution {
    public int strStr(String haystack, String needle) {
    	if("".equals(needle)) {
        	return 0;
        }else if(needle.length()> haystack.length()) {
        	return -1;
        }
    	
    	
    	for(int i = 0; i<haystack.length(); i++) {
    		int tempAns = deepSearch(i, haystack, needle, i, 0);
    		if(tempAns == -1) {
    			continue;
    		}else {
    			return tempAns;
    		}
    	}
    	
    	return -1;
    }
    
    private int deepSearch(int haystackFirstSameIndex, String haystack, String needle, int thisHayStackIndex, int thisNeedleIndex) {
    	if(thisNeedleIndex == needle.length()) {
    		return haystackFirstSameIndex;
    	}else if(thisHayStackIndex == haystack.length()) {
    		return -1;
    	}
    	if(haystack.charAt(thisHayStackIndex) == needle.charAt(thisNeedleIndex)) {
    		return deepSearch(haystackFirstSameIndex, haystack, needle, thisHayStackIndex+1, thisNeedleIndex+1);
    	}else {
    		return -1;
    	}
    }
    
    public static void main(String[] args) {
    	Solution sol = new Solution();
//    	int ans = sol.strStr("hello", "ll");
//    	int ans = sol.strStr("method", "h");
//    	int ans = sol.strStr("aaaaa", "bba");
//    	int ans = sol.strStr("aaa", "aaaa");
//    	int ans = sol.strStr("mississippi", "issipi");
    	int ans = sol.strStr("", "");
    	System.err.println(ans);
    	
    }
}
